import React from 'react';

function MetadataDisplay({ metadata }) {
  if (!metadata || Object.keys(metadata).length === 0) {
    return <p>No metadata to display.</p>;
  }

  return (
    <div className="mt-4 p-4 bg-gray-50 rounded-md shadow-inner max-h-96 overflow-y-auto">
      <h3 className="text-lg font-medium text-gray-900 mb-2">Metadata Details:</h3>
      <ul className="list-disc list-inside space-y-1 text-sm text-gray-700">
        {Object.entries(metadata).map(([key, value]) => (
          <li key={key}>
            <span className="font-semibold">{key}:</span> {JSON.stringify(value)}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default MetadataDisplay;
